import React from 'react';
import Keyboard from '../components/Keyboard';

const MainPage = () => {
	return (
		<div className="main-page">
			<div className="content">
				<div className="logo">
					<h1>SynthPiser</h1>
				</div>
				<div>
					<Keyboard />
				</div>
			</div>
		</div>
	);
};

export default MainPage;
